import { Link, Route, Router, Routes } from 'react-router-dom';
import React from 'react';
import Main from './test';
import UserCabinet from './user';


export default function Header() {
  return(
  <>
    <Router>
      <ul className="nav nav-pills nav-fill main-color display-6">
        <a className="nav-link link-light d-flex align-items-center" href="http://localhost:3000/">TestName</a>
        <nav className="navbar navbar-dark">
          <button className="btn btn-outline-secondary d-flex btn-lg" data-bs-toggle="collapse" data-bs-target="#header-navbar">
          <span className="navbar-toggler-icon"></span>
          </button>
        </nav>
      </ul>
      <div id="header-navbar" className="collapse">
      <ul className="row nav nav-pills nav-fill main-color display-5 header-menu">
        <li className="col-12 col-sm-4 nav-item">
          <Link to="/profile"> <p className="nav-link link-light h3">Личный кабинет</p> </Link>
        </li>
        <li className="col-12 col-sm-4 nav-item">
          <Link to="/" ><p className="nav-link link-light h3">Мои заказы</p> </Link>
        </li>
        <li className="col-12 col-sm-4 nav-item">
          <Link to="/qanda"> <p className="nav-link link-light h3">Тех. Поддержка</p> </Link>
        </li>
      </ul>
      </div>
    </Router>
    <Routes>
      <Route path="/profile" Component={<UserCabinet />}/>
      <Route path="/" Component={<Main />}/>
      <Route path="/qanda">
        <UserCabinet />
      </Route>
    </Routes>
    </>
  );
};
